import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>메인 페이지</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isReactive,
};

export default AppLayout;
